import React from "react";

const LiveBiddingHelper = ({ player }) => {
  return (
    <div>
      <h1>{player.name}</h1>
      <img src={player.Image} alt="No Image" height="500px"></img>
      <span>
        <h3>Batting Average:{player.Batavg}</h3>
      </span>
    </div>
  );
};

export default LiveBiddingHelper;
